import FullScreenModal from "@/components/reusable/FullScreenModal";
import { useRespVal } from "@/utils/hooks/hooks";
import {
  Card,
  CardContent,
  Typography,
  CardActionArea,
  Grid,
} from "@mui/material";
import { useState } from "react";

export default function UserLicenses() {
  const [openModal, setOpenModal] = useState(false);
  const [activeLicense, setActiveLicense] = useState(licenses?.[0]);

  return (
    <>
      <Typography variant="h5" sx={{ mb: 2 }}>
        Licenses
      </Typography>
      <Grid
        container
        direction={"row"}
        spacing={1}
        sx={{ overflowX: "auto", flexWrap: "nowrap", pb: 0.3 }}
      >
        {licenses.map((l) => (
          <Grid item key={l.id}>
            <Card sx={{ width: 150, height: "100%" }}>
              <CardActionArea
                onClick={() => {
                  setActiveLicense(l);
                  setOpenModal(!openModal);
                }}
              >
                <embed src={l.picture} type={l.type} width="150" height="150" />
                <CardContent>
                  <Typography
                    variant="body2"
                    color="text.secondary"
                    className="ellipsis2Line"
                  >
                    {l.desc}
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </Grid>
        ))}
      </Grid>
      {activeLicense && (
        <FullScreenModal
          title={activeLicense?.desc}
          open={openModal}
          setOpen={setOpenModal}
        >
          <embed
            src={activeLicense.picture}
            style={{ width: "100%", minHeight: useRespVal(500, "92vh") }}
            type={activeLicense.type}
          />
        </FullScreenModal>
      )}
    </>
  );
}

const licenses = [
  {
    name: "checkmate certificate.PNG",
    size: 294163,
    type: "image/png",
    picture:
      "data:image/png;base64,",
    id: "0.4n8qgn50zdv",
    desc: "CheckMate Tile Installation",
  },
  {
    name: "Photo Specs.pdf",
    size: 1303486,
    type: "application/pdf",
    desc: "A PDF license",
    picture:
      "data:application/pdf;base64,",
    id: "0.tszgvavtppd",
  },
];
